import React from 'react'
import {Link} from 'react-router-dom'

const LinkRoute = ({tabs}) => (
        <div>
              {tabs.map(tab=>
                <Link className="nav-link"
                activeClass="active"
                to={tab.link} style={{color:"#A6D230",fontSize:"25px"}}>{tab.text}</Link>
			      )}
        </div>

)
export default LinkRoute
